import React, { PureComponent } from 'react'
import './Inicio.scss';

import logo from '../img/maicom.jpg'

class Banner extends PureComponent {

    render() {
        return (
            <div id="banner">
                <div className="paginaPrincipal">
                    <div >
                        <img src={logo}/>
                        <h1 className="mercado"><b>MAICOM G. SOARES</b></h1>
                    </div>
                    <h3 className="titulo">A perfeição não é alcançada quando não há mais nada a ser incluído. 
                    A perfeição é alcançada quando não há mais nada a ser retirado.Antoine de Saint-Exupéry</h3>
                </div>
            </div>

        )
    }
}

export default Banner
